import {motion} from 'framer-motion'
const Home = () => {
    const line1 = "Hi! I am"
    const line2 = "Jatin Rastogi"
    const sentence = {
        hidden: {opacity:1},
        visible : {
            opacity:1,
            transition: {
                delay:0.5,
                staggerChildren:0.08,
            },
        },
    }
    const letter = {
        hidden : { opacity:0,y:50},
        visible : {
            opactiy:1,
            y:0,
        },
    }
    return (
        <div className="home" >         
        <motion.h4 variants={sentence} initial="visible" animate="visible">
              {line1.split("").map((char,index) => {
                  return (
                      <motion.span key={char + "-" + index} variants={letter}>
                          {char}
                      </motion.span>
                  )
              })}
        </motion.h4>

        <h1>
            Jatin Rastogi
        </h1>

        </div>
    )
}

export default Home
